original_question:
Mraba kumi na mbili wa ukubwa wa 1 kwa 1 huunda mstatili, kama inavyoonyeshwa. Je, ni eneo gani jumla la sehemu iliyotiwa kivuli? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Sehemu zilizojazwa
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// gridi
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

//diagonali
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

